import React from "react";
import "./workdetails.css";
import SingleCard from "../Card/SingleCard";

class Workdetails extends React.Component {
  render() {
    let abc = "./" + this.props.imagePath.toLowerCase() + ".jpg";
    let output = require("./one.jpg");
    output = <div className="row">
        <div className="work-details col-md-4 col-sm justify-content-center align-self-center">
          <p className="h2 text-muted">
            {this.props.details} This is Fixed This is Fixed This is Fixed
            This is Fixed This is Fixed
          </p>
        </div>
        <div className="work-img col-sm">
          {/* <h1>{this.props.imagePath}</h1> */}
          {/* <img src={this.props.imagePath} alt={this.props.imagePath} /> */}
          <div class="card-deck text-light">
            <SingleCard details="This is a wider card with supporting text below as a natural
              lead-in to additional content. This content is a little bit
              longer." background="#23B6C9" link="//www.gstatic.com/mobilesdk/160505_mobilesdk/discoverycards/2x/storage.png" title="This is first section" />
          </div>
        </div>
      </div>;

    return output;
  }
}

export default Workdetails;
